import * as React from 'react';
import { SideBarListElement } from './SideBarListElement'

interface Props {

}

const myStyle = {
    margin: '50px 0px',
    color: '#FFF',
    padding: '50px'
}

export const SideBarList: React.FC<Props> = () => {
    return ( 
        <div>
            <ul style={myStyle}>

                <li className='left-list-element'>Assets</li>
                <li className='left-list-element'>Trade</li>
                <li className='left-list-element'>Pay</li>
                <li className='left-list-element'>For You</li>
                <li className='left-list-element'>Learn and earn</li>
                <li className='left-list-element'>Notifications</li>
                <li className='left-list-element'>Invite Friends</li>
            </ul>
        </div>
     );
}
